import Head from 'next/head'
import styles from '../styles/Home.module.css'
import DaihatsuLogo from '../public/Daihatsu-Logo.wine__1_-removebg-preview.png'
import { useEffect, useState } from 'react'
import { useQueueState } from '../store/QueueState'
import { Button, Modal, ModalBody, ModalFooter, ModalHeader } from 'reactstrap'
import { useMutation, useQuery } from 'react-query'
import jsPDF from 'jspdf'


export default function Home() {
  const { queueData , queueInput , queueInputReset , respQueueData, respQueueInput} = useQueueState((state)=>state)
  const [ showModal , setShowModal ] = useState(false)
  const [ datauripdf , setDatauripdf ] = useState()
  const [ resp , setResp ] = useState({})
  const [ showErrorModal , setShowErrorModal ] = useState(false)
  const toggleError = () => setShowErrorModal(!showErrorModal)
  const toggle = () => setShowModal(!showModal);


  useEffect(()=>{
    if(showModal == true){
      if (resp != {} || resp != undefined){
        setShowModal(true)
        handlePrint()
      }
    }
  },[resp, showModal])

  const addQueue = async() => {
    const req = await fetch(`http://localhost:3000/api/queue`,{
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(queueData)
    })
    const response = await req.json()

    if (response.response.message !== "success") {
      setResp(response.response.queue)
      handleResp(response)
      setShowModal(true)
      // handlePrint()
      // handlePrintfn(resp)

    } else {
      setShowErrorModal(true)
    }
  }

  const handleResp = (response) => {
    respQueueInput("customer_name" , response.response.queue.name)
    respQueueInput("plat_number" , response.response.queue.plat_number)
    respQueueInput("car_type" , response.response.queue.car_type)
    respQueueInput("arrival_date" , response.response.queue.arrival_date)
    respQueueInput("arrival_time" , response.response.queue.arrival_time)
    respQueueInput("complaint" , response.response.queue.complaint)
  }

  const handlePrint = () =>{
    const doc = new jsPDF({
      format : 'a5',
      unit : 'px'
    })
  

    doc.setDocumentProperties({title: "Pendaftaran Service Daihatsu"})

    var logo = "data:image/png;base64,"
    doc.addImage(logo , "png",110, 20, 90 , 20 , "FAST")

    doc.setLineWidth(2)
    doc.line(10, 10, 305, 10)
    doc.line(10, 430, 305, 430)

    doc.setFont("Helvetica", "bold")
    doc.setFontSize(15)
    doc.text("Bukti Pendaftaran Service" , 90 , 55 )
    
    doc.setFont("Helvetica","Oblique")
    doc.setFontSize(11)
    doc.text( "Nama" , 30 , 95)
    doc.text( "Plat Nomor" , 30 ,135)
    doc.text( "Jenis Mobil" , 160 , 135 )
    doc.text( "Tanggal Kedatangan" , 30 , 175 )
    doc.text( "Jam Kedatangan" , 160, 175 )
    doc.text( "Keluhan" , 30, 215 )

    
    doc.setFont("Helvetica", "normal")
    doc.setFontSize(11)
    
    doc.text( resp.name , 30 , 110)
    doc.text( resp.plat_number , 30 ,150)
    doc.text( resp.car_type , 160 , 150 )
    doc.text( resp.arrival_date , 30 , 190 )
    doc.text( resp.arrival_time , 160, 190 )
    doc.text( resp.complaint , 30, 230 )
    // doc.text( respQueueData.customer_name , 30 , 110)
    // doc.text( respQueueData.plat_number , 30 ,150)
    // doc.text( respQueueData.car_type , 160 , 150 )
    // doc.text( respQueueData.arrival_date , 30 , 190 )
    // doc.text( respQueueData.arrival_time , 160, 190 )
    // doc.text( respQueueData.complaint , 30, 230 )


    var data = doc.output('dataurl')
    setDatauripdf(data)
    // doc.save("Bukti_daftar_servis_daihatsu");
    doc.autoPrint()
  }
  console.log(resp)
  console.log(respQueueData)
  console.log(queueData)
  return (
    <>
      <nav className="navbar bg-body-tertiary shadow">
        <div className="container-fluid">
          <a className="navbar-brand" href="/">
            <img src={DaihatsuLogo.src} alt="Logo" width={180} height={40}  />
            {/* Bootstrap */}
          </a>
        </div>
      </nav>
      <div className='p-1 mt-5 container-fluid'>
        <div className='row'>
          <div className='col-md-10 col-lg-6 offset-md-1 offset-lg-3'>
        
          <div className='shadow border border-1 border-primary-subtle rounded top-20 p-5'>
            <div className='my-2 mb-4 px-2 border-start border-4 border-danger'>
              <h3>Pendaftaran Servis</h3>
            </div>
            {/* Form */}
            <form onSubmit={(e)=>{e.preventDefault(); addQueue()}}>
              <div className="mb-3 form-floating">
                <input type="text" className="form-control" id="customerNameInput" placeholder="" value={queueData?.customer_name} required onChange={(e)=>{e.preventDefault; queueInput("customer_name" , e.target.value)}}/>
                <label htmlFor="customerNameInput" className="form-label">Nama</label>
              </div>
              <>
                <div className='d-md-flex gap-3'>
                  <div className='flex-fill form-floating mb-3'>
                    <input type="text" className="form-control" id="platNumberInput" placeholder="" value={queueData?.plat_number} required onChange={(e)=>{e.preventDefault; queueInput("plat_number" , e.target.value)}}/>
                    <label htmlFor="platNumberInput" className="form-label">Plat Nomor</label>
                  </div>
                  <div className='flex-fill form-floating mb-3'>
                    
                    <select className="form-select" aria-label="Default select example" id='selectCar' required value={queueData?.car_type} onChange={(e)=>{e.preventDefault; queueInput("car_type" , e.target.value)}}>
                      {/* <option selected>Pilih Jenis Mobil</option> */}
                      <option value="Ayla" defaultChecked>Ayla</option>
                      <option value="Sigra">Sigra</option>
                      <option value="Xenia">Xenia</option>
                      <option value="Terios">Terios</option>
                      <option value="Rocky">Rocky</option>
                      <option value="Sirion">Sirion</option>
                      <option value="Granmax Minibus">Granmax Minibus</option>
                      <option value="Granmax Blinvan">Granmax Blinvan</option>
                      <option value="Granmax Pickup">Granmax Pickup</option>
                      <option value="Luxio">Luxio</option>
                    </select>
                    <label htmlFor="selectCar" className="form-label">Jenis Mobil</label>
                  </div>
                </div>
              </>
              <div className="mb-3 form-floating">
                <input type="date" className="form-control" id="arvDateInput" placeholder="" value={queueData?.arrival_date} required onChange={(e)=>{e.preventDefault; queueInput("arrival_date" , e.target.value)}}/>
                <label htmlFor="arvDateInput" className="form-label">Tanggal Kedatangan</label>
              </div>
              <div className="mb-3 form-floating">
                <textarea type="text" className="form-control" id="complaintInput" placeholder="" value={queueData?.complaint} required onChange={(e)=>{e.preventDefault; queueInput("complaint" , e.target.value)}}/>
                <label htmlFor="complaintInput" className="form-label">Keluhan</label>
              </div>
              <div className='d-flex justify-content-end pt-2'>
                <button className='p-2 px-5 btn btn-danger' type='submit'>Daftar</button>
              </div>
            </form>
          </div>

          </div>
        </div>

        <div>
          <Modal isOpen={showModal} fullscreen={'md'} size='lg'>
            <ModalHeader toggle={toggle}>Pendaftaran berhasil</ModalHeader>
            <ModalBody className='vh-100'>
              <div className='container-fluid w-100 h-100'>
                <iframe itemType='application/pdf' src={datauripdf} className='w-100 h-100'></iframe>
              </div>
            </ModalBody>
          </Modal>
        </div>
        <div>
          <Modal isOpen={showErrorModal} size='lg'>
            <ModalHeader toggle={toggleError}>Error</ModalHeader>
            <ModalBody>
              <div className='container justify-content-center'>
                  <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" dataSlot="icon" className="w-6 h-6">
                    <path strokeLinecap="round" strokeLinejoin="round" d="M12 9v3.75m-9.303 3.376c-.866 1.5.217 3.374 1.948 3.374h14.71c1.73 0 2.813-1.874 1.948-3.374L13.949 3.378c-.866-1.5-3.032-1.5-3.898 0L2.697 16.126ZM12 15.75h.007v.008H12v-.008Z" />
                  </svg>
              </div>
            </ModalBody>
          </Modal>
        </div>
      </div>
    </>
  )
}
